import React from 'react'
import styled from 'styled-components'
const Container = styled.div`
display:flex;padding:2px;
border:solid 
`;
const TodoItem = ({item}) => {
    return (
        <Container>
            {item.title}
        </Container>
    )
}

export default TodoItem
